import Table from 'react-bootstrap/Table';
import { useState, useEffect } from 'react';

export const TableData = (props) => {
  const headers = ['First Name', 'Last Name', 'User Name'];
  const data = {
    nombre: 'Luis Robles',
    tipo_alimento: 'desayuno',
    hora: '6:45',
    ubicacion: 'parque solidaridad',
    '': '',
  };
  const [keys, setKeys] = useState([]);
  useEffect(() => {
    if (data) {
      setKeys(Object.keys(data).filter((key) => key != ''));
    }
  }, [data]);
  return (
    <Table striped bordered hover size='sm'>
      <thead>
        <tr>
          <th>#</th>
          {headers.map((header, index) => (
            <th key={header + index}>{header}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
        <tr>
          <td>2</td>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
        </tr>
        <tr>
          <td>3</td>
          <td colSpan='2'>Larry the Bird</td>
          <td>@twitter</td>
        </tr>
      </tbody>
    </Table>
  );
};

export default TableData;
